  \"2015-09-26T19:33:08.433456\",\n\t\"name\": \"fish-species-observed-in-the-hawaii-exclusive-economic-zone-from-the-1750s-through-2003-nodc-ac\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A list of Hawaiian fish species was created
  from contemporary and historical documents dating back to 1758. For each species,
  the name of the person who described and first named the species (according to The
  International Code of Zoological Nomenclature) along with the date of the description,
  the family, the status (indigenous, etc.), the range along the Hawaiian archipelago
  for the sightings, and miscellaneous notes are given. Observations were taken within
  the 200 nmi Hawaiian Exclusive Economic Zone. The list was taken from \"A Checklist
  of the Fishes of the Hawaiian Archipelago\" by B. Mundy, in press, B. P. Bishop
  Museum Bulletin of Zoology, Bishop Museum Press.\",\n\t\"license_title\": null,\n\t\"extras\":
